Filipino Weapons Training 1 of 3 - iPod

DVD Rip to iPod

Producer: Ron Balicki

Compilation of the Filipino arts of Lameco Escrima and the Inosanto Lacosta systems of Kali. Influenced by many filipino fighting techniques taught and handed down from Dan Inosanto and Edgar Sulite.

Volume 1:  
This volume contains a non-style specific instruction that includes Lameco-Illustrismo System, numbering system, Angle's 1-5, feeding the attack lines. Single stick, double stick, baseball grip, left and right hand techniques, footwork, empty hands training vs. weapon attack, stick-to-stick, pass, stop as well as stop and hit. 


Keywords: silat, escrima, kali, knife fighting, self defense, martial art, stick fighting

